import React, { Component } from 'react';

import '../css/DivInfo.css';
import { Jumbotron, Container } from 'react-bootstrap'

export default class DivInfo extends Component {
    render() {
        return (
            <>
                <Jumbotron id="box-div-info">
                    <Container id="certificado">
                        
                    </Container>
                </Jumbotron>
            </>
        );
    }
}
